import * as React from 'react';
import { Paper, Card, CardContent, Typography } from '@mui/material';
import "./welcome.css"

export default function Welcome() {
  return (
    <>
    <div className='root'>
    <Typography variant="h5" component="h2" sx={{
          position: 'absolute',
          bottom: 0,
          left: 0,
          width: '100%',
          textAlign: 'start',
          paddingLeft: '20px',
        }}>
          Hello
        </Typography>
        <Box sx={{
        marginTop: 20,
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        width:1,
        height:1,
      }}>
      <Typography variant="h3" component="div" sx={{ flexGrow: 1}}>
            Welcome to Poodle Classroom!
      </Typography>
    </Box>
    </div>
    
    </>
  );
}
